import { Component } from 'react';
import { Link } from 'react-router';

class Home extends Component {
	constructor(props) {
		super(props);
		this.state = {}
	}
	render() {
		return (<div className="homeContainer">
			<Link to="/login">Login</Link>
			<Link to="/cadastro">Cadastro</Link>
		</div>);
	}
}

export default Home;
